# Step 1: 多边形转点并去重
def convert_polygons_to_points(geojson_data):
    points = []
    seen_ids = set()
    
    for feature in geojson_data['features']:
        if feature['geometry']['type'] == 'Polygon':
            polygon = shape(feature['geometry'])
            for point_id, point_props in enumerate(feature['properties']['points_properties']):
                point = {
                    'type': 'Feature',
                    'geometry': {
                        'type': 'Point',
                        'coordinates': polygon.exterior.coords[point_id]
                    },
                    'properties': {
                        'id': point_props['id'],
                        'depth': point_props['depth'],
                        'value': point_props['value']
                    }
                }
                if point['properties']['id'] not in seen_ids:
                    points.append(point)
                    seen_ids.add(point['properties']['id'])
    
    return {'type': 'FeatureCollection', 'features': points}

# Step 2: 多边形融合并保留孔洞
def merge_polygons_with_holes(geojson_data):
    polygons = []
    for feature in geojson_data['features']:
        polygons.append(shape(feature['geometry']))
    
    merged_polygon = unary_union(polygons)
    
    if isinstance(merged_polygon, MultiPolygon):
        merged_features = [{'type': 'Feature', 'geometry': mapping(poly)} for poly in merged_polygon.geoms]
    else:
        merged_features = [{'type': 'Feature', 'geometry': mapping(merged_polygon)}]
    
    return {'type': 'FeatureCollection', 'features': merged_features}

# Step 3: 多边形转线，提取线段
def convert_polygons_to_lines(geojson_data):
    polygons = [shape(feature['geometry']) for feature in geojson_data['features']]
    merged_polygon = unary_union(polygons)
    
    if isinstance(merged_polygon, MultiPolygon):
        boundary_lines = merged_polygon.boundary
    else:
        boundary_lines = merged_polygon.boundary
    
    lines = [{'type': 'Feature', 'geometry': mapping(boundary_lines)}]
    
    return {'type': 'FeatureCollection', 'features': lines}

# Step 4: 点和线的相交分析
def analyze_points_and_lines(points_data, lines_data):
    points = [shape(feature['geometry']) for feature in points_data['features']]
    lines = [shape(feature['geometry']) for feature in lines_data['features']]
    
    # Perform intersection analysis
    intersected_points = []
    
    for point_feature in points_data['features']:
        point_geometry = shape(point_feature['geometry'])
        point_properties = point_feature['properties']
        point_id = point_properties['id']
        
        for line_feature in lines_data['features']:
            line_geometry = shape(line_feature['geometry'])
            if point_geometry.intersects(line_geometry):
                intersection = point_geometry.intersection(line_geometry)
                if intersection.geom_type == 'Point':
                    # Store intersected point with its properties
                    intersected_points.append({
                        'type': 'Feature',
                        'geometry': {
                            'type': 'Point',
                            'coordinates': (intersection.x, intersection.y)
                        },
                        'properties': point_properties
                    })
    
    return {'type': 'FeatureCollection', 'features': intersected_points}

# Step 5: 更新三角形顶点属性
def update_triangle_vertex_properties(triangles_data, updated_points_data):
    for triangle in triangles_data['features']:
        triangle_points = triangle['properties']['points_properties']
        for point_prop in triangle_points:
            for updated_point in updated_points_data['features']:
                if updated_point['properties']['id'] == point_prop['id']:
                    point_prop['value'] = 2  # Update value to 1 based on intersection analysis
    
    return triangles_data

    # Step 6: 计算geojson的bbox

def calculate_geojson_bbox(geojson_data):
    bbox = [float('inf'), float('inf'), float('-inf'), float('-inf')]  # [minx, miny, maxx, maxy]
    
    if geojson_data['type'] == 'FeatureCollection':
        features = geojson_data['features']
    elif geojson_data['type'] == 'Feature':
        features = [geojson_data]
    else:
        raise ValueError('Input GeoJSON data should be either a Feature or FeatureCollection.')

    for feature in features:
        if feature['geometry']['type'] == 'Polygon':
            coords = feature['geometry']['coordinates'][0]  # Assuming exterior ring
        elif feature['geometry']['type'] == 'MultiPolygon':
            coords = feature['geometry']['coordinates'][0][0]  # Assuming exterior ring of the first polygon
        else:
            raise ValueError('Geometry type must be either Polygon or MultiPolygon.')
        
        for coord in coords:
            bbox[0] = min(bbox[0], coord[0])  # minx
            bbox[1] = min(bbox[1], coord[1])  # miny
            bbox[2] = max(bbox[2], coord[0])  # maxx
            bbox[3] = max(bbox[3], coord[1])  # maxy
    
    return bbox

 # Step 7: 使用bbox裁剪全球岸线的shp文件


def crop_shp_by_bbox(bbox, shp_path):
    print(bbox)
    # Create a bounding box geometry
    bounding_box = box(bbox[0], bbox[1], bbox[2], bbox[3])
    
    # Read the Shapefile
    gdf = gpd.read_file(shp_path).clip(bounding_box)
 
    return gdf
