import pandas as pd
def analyze_intersected_points(buffered_points_dat, cropped_shp_data, updated_points_data):
    # 读取 GeoDataFrame 格式的 buffered_points_dat 和 cropped_shp_data
    buffered_points_gdf = buffered_points_dat.set_crs('EPSG:4326')
    cropped_shp_gdf = cropped_shp_data.set_crs('EPSG:4326')

    # 转换 updated_points_data 为 GeoDataFrame
    updated_points_gdf = gpd.GeoDataFrame.from_features(updated_points_data)
    updated_points_gdf = updated_points_gdf.set_crs('EPSG:4326')

    # 添加空间索引
    buffered_points_gdf.sindex
    cropped_shp_gdf.sindex

    # # 进行相交分析
    # intersected = gpd.overlay(buffered_points_gdf, cropped_shp_gdf, how='intersection')



    
    # 初始化一个空的 GeoDataFrame，用于保存不相交的
    gdf_non_intersecting = gpd.GeoDataFrame(columns=buffered_points_gdf.columns, crs=buffered_points_gdf.crs)

    # 对每个三角形，使用 bounding box 预筛选 Shapefile 中可能相交的对象
    for idx, triangle in buffered_points_gdf.iterrows():
        possible_matches_index = list( cropped_shp_gdf.sindex.intersection(triangle.geometry.bounds))
        possible_matches = cropped_shp_gdf.iloc[possible_matches_index]

        # 检查是否真的相交，如果没有相交，则保留该三角形
        if  possible_matches.intersects(triangle.geometry).any():
            # 使用 pd.concat 替代 append
            gdf_non_intersecting = pd.concat([gdf_non_intersecting, gpd.GeoDataFrame([triangle], columns=buffered_points_gdf.columns)], ignore_index=True)
    # 设置 CRS 为 EPSG:4326（WGS84），确保有投影信息
    if gdf_non_intersecting.crs is None:
        gdf_non_intersecting.set_crs(epsg=4326, inplace=True)

    # 将结果保存为 Shapefile
    #gdf_non_intersecting.to_file(output_shp_path, driver='ESRI Shapefile')
        # # 转换为 GeoJSON 格式
    # intersected_points_geojson = gdf_non_intersecting.to_crs(epsg=4326).__geo_interface__

     # # 使用空间连接获取相交的点
    intersected_points_gdf = gpd.sjoin(updated_points_gdf, gdf_non_intersecting )

    # # 转换为 GeoJSON 格式
    intersected_points_geojson = intersected_points_gdf.to_crs(epsg=4326).__geo_interface__

    return intersected_points_geojson
 
